import UserItem from "./UserItem";

const Users = (props) => {
    console.log("users", props.users);
  return (
    <ul>
      {props.users?.length >0 && props.users.map((user, idx) => (<UserItem username={user.username} age={user.age}></UserItem>))}
    </ul>
  );
};
export default Users;
